  summary: "\nCarrier object for ForeignAppEntity.\nServices for the ForeignAppEntity Carrier is available from the <xref href=\"SuperOffice.CRM.Services.IForeignSystemAgent\" data-throw-if-not-resolved=\"false\"></xref>.\n"
  example:
  - "\nGet ForeignAppEntity 123 using the agent:\n<pre><code> using SuperOffice;\n using SuperOffice.CRM.Services;\n\n using (SoSession mySession = SoSession.Authenticate(&quot;user&quot;, &quot;pass&quot;))\n {\n    var agent = new ForeignSystemAgent();\n    var foreignAppEntity = agent.GetForeignAppEntity( 123 );\n }</code></pre>\n\nFind all ForeignAppEntity, get related items using archive agent.\n<pre><code>var archive = new ArchiveAgent();\nvar rows = archive.GetArchiveListByColumns2(&quot;ForeignKeys&quot;, &quot;...&quot;, null, &quot;getAllRows eq 1&quot;, null, 0, 100 );</code></pre>\n"
  syntax:
    content: 'public class ForeignAppEntity : Carrier'
    content.vb: >-
      Public Class ForeignAppEntity

          Inherits Carrier
